import React, { useEffect, useState } from "react";

export default function Todo() {
    const [title,setTitle]=useState("");
    const [Description,setDescription]=useState("");
    const [todos,setTodos]=useState([])
    const [error,setError]=useState("");
    const [editId,seteditId]=useState(-1);
    const [message,setMessage]=useState("");
     const [edittitle,seteditTitle]=useState("");
    const [editDescription,seteditDescription]=useState("");
    const apiUrl="http://localhost:8000"
    const handleSubmit=()=>{
        setError("")
        if(title.trim() !==''&& Description.trim()!==''){
            fetch(apiUrl + "/todos", {
                method: "POST",
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify({ title, description: Description })
            })
            .then(async (res) => {
                if (res.ok) {
                    setTodos([...todos, { title, description: Description }]);
                    setTitle("");
                    setDescription("");
                    setMessage("Item added successfully ");
                    setTimeout(() => {
                        setMessage("");
                    }, 3000);
                    setError("");
                } else {
                    const errorData = await res.json().catch(() => ({}));
                    setError("Unable to create todo item: " + (errorData.error || res.statusText));
                }
            })
            .catch((err) => {
                setError("Network error: " + err.message);
            });
           

        }
         
    }
    useEffect(()=>{
        getItems()
    },[])
    const getItems=() =>{
        fetch(apiUrl+"/todos")
        .then((res)=> res.json())   
        .then((res)=>{
            setTodos(res)
        })
    } 
    const handleEdit=(item)=>{
        seteditId(item._id);
        seteditTitle(item.title);
        seteditDescription(item.description)
    }
    const handleEditCancel=()=>{
        seteditId(-1);
    }
    const handleUpdate=()=>{
         setError("")
        if(edittitle.trim() !==''&& editDescription.trim()!==''){
            fetch(apiUrl + "/todos/"+editId, {
                method: "PUT",
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify({title: edittitle, Description: editDescription })
            })
            .then(async (res) => {
                if (res.ok) {
                   const updatedTodos= todos.map((item) =>{
                        if(item._id==editId){
                            item.title= edittitle;
                            item.description=editDescription;
                        }
                        return item;
                    })
                    setTodos(updatedTodos);
                    seteditTitle("");
                    seteditDescription("");
                    setMessage("Item updated successfully ");
                    setTimeout(() => {
                        setMessage("");
                    }, 3000);
                    seteditId(-1)
                    setError("");
                } else {
                    const errorData = await res.json().catch(() => ({}));
                    setError("Unable to create todo item: " + (errorData.error || res.statusText));
                }
            })
            .catch((err) => {
                setError("Network error: " + err.message);
            });
           

        }

    }
    const handledelete=(id)=>{
        if(window.confirm("Are ypu sure to delete this?")){
            fetch(apiUrl+"/todos/"+id,{
                Method: "DELETE"
            })
            .then(()=>{
               const updatedTodos= todos.filter((item)=>item._id!==id)
               setTodos(updatedTodos);
            })
        }

    }
    return (
        <div className="container py-5" style={{ minHeight: "100vh", background: "linear-gradient(135deg, #232526 0%, #414345 100%)" }}>
            <div className="row justify-content-center mb-4">
                <div className="col-md-8 text-center">
                    <h1 className="display-4 fw-bold text-white mb-3" style={{ letterSpacing: "2px" }}>📝 To Do Works</h1>
                    <p className="lead text-light-50 mb-0">Organize your tasks efficiently and stay productive!</p>
                </div>
            </div>
            <div className="row justify-content-center mb-4">
                <div className="col-md-8">
                    <div className="card shadow-lg border-0">
                        <div className="card-body bg-dark rounded-3">
                            <h3 className="text-white mb-3">Add Item</h3>
                            {message && <div className="alert alert-success py-2">{message}</div>}
                            <div className="form-group d-flex gap-2 mb-2">
                                <input
                                    placeholder="Title"
                                    onChange={(e) => setTitle(e.target.value)}
                                    value={title}
                                    className="form-control form-control-lg"
                                    type="text"
                                    style={{ background: "#232526", color: "#fff", border: "none" }}
                                />
                                <input
                                    placeholder="Description"
                                    onChange={(e) => setDescription(e.target.value)}
                                    value={Description}
                                    className="form-control form-control-lg"
                                    type="text"
                                    style={{ background: "#232526", color: "#fff", border: "none" }}
                                />
                                <button className="btn btn-primary btn-lg px-4" onClick={handleSubmit}>Add</button>
                            </div>
                            {error && <div className="alert alert-danger py-2">{error}</div>}
                        </div>
                    </div>
                </div>
            </div>
            <div className="row justify-content-center">
                <div className="col-md-8">
                    <div className="card shadow-lg border-0">
                        <div className="card-body bg-light rounded-3">
                            <h3 className="mb-4 text-dark">Tasks</h3>
                            <ul className="list-group">
                                {todos.length === 0 && (
                                    <li className="list-group-item text-center text-muted py-4" style={{ background: "#f8f9fa" }}>
                                        No tasks yet. Add your first task!
                                    </li>
                                )}
                                {todos.map((item) => (
                                    <li
                                        key={item._id}
                                        className="list-group-item d-flex justify-content-between align-items-center my-2 shadow-sm"
                                        style={{
                                            background: editId === item._id ? "#e3f2fd" : "#f8f9fa",
                                            borderRadius: "0.5rem",
                                            border: "none"
                                        }}
                                    >
                                        <div className="d-flex flex-column me-2 w-75">
                                            {editId === item._id ? (
                                                <div className="d-flex gap-2">
                                                    <input
                                                        placeholder="Title"
                                                        onChange={(e) => seteditTitle(e.target.value)}
                                                        value={edittitle}
                                                        className="form-control"
                                                        type="text"
                                                        style={{ background: "#fff" }}
                                                    />
                                                    <input
                                                        placeholder="Description"
                                                        onChange={(e) => seteditDescription(e.target.value)}
                                                        value={editDescription}
                                                        className="form-control"
                                                        type="text"
                                                        style={{ background: "#fff" }}
                                                    />
                                                </div>
                                            ) : (
                                                <>
                                                    <span className="fw-bold fs-5 text-dark">{item.title}</span>
                                                    <span className="text-secondary">{item.description}</span>
                                                </>
                                            )}
                                        </div>
                                        <div className="d-flex gap-2">
                                            {editId === item._id ? (
                                                <>
                                                    <button className="btn btn-success btn-sm" onClick={handleUpdate}>Update</button>
                                                    <button className="btn btn-warning btn-sm" onClick={handleEditCancel}>Cancel</button>
                                                </>
                                            ) : (
                                                <>
                                                    <button className="btn btn-outline-primary btn-sm" onClick={() => handleEdit(item)}>Edit</button>
                                                    <button className="btn btn-outline-danger btn-sm" onClick={() => handledelete(item._id)}>Delete</button>
                                                </>
                                            )}
                                        </div>
                                    </li>
                                ))}
                            </ul>
                        </div>
                    </div>
                </div>
            </div>
            <style>{`
                body {
                    background: #232526;
                }
                .form-control:focus {
                    box-shadow: 0 0 0 0.2rem rgba(0,123,255,.25);
                }
                .btn-primary {
                    background: linear-gradient(90deg, #007bff 0%, #0056b3 100%);
                    border: none;
                }
                .btn-primary:hover {
                    background: linear-gradient(90deg, #0056b3 0%, #007bff 100%);
                }
            `}</style>
        </div>
    );
}
